import { Card, Button } from "react-bootstrap";

const Home = () => {
    return (  
        <div>
            <Card className="m-2">
                <Card.Img style={{"height":"400px","margin":"auto"}} className="w-75 " src="https://www.ionos.fr/digitalguide/fileadmin/DigitalGuide/Teaser/e-commerce.jpg"></Card.Img>
                <Card.Body className="text-center">
                    <Card.Title>Discount Picker</Card.Title>
                    <Card.Text>Trouvez les meilleurs prix, promotions et ventes flash sur les sites e-commerce Tunisiens</Card.Text>
                    <Button variant="info">Consulter les promotions</Button>
                </Card.Body>
            </Card>
        </div>
    );
}
 
export default Home;
